window.bookSummaryJSON = "<p>The thrilling final installment in The Sainthood series by<i> USA Today</i> best-selling author Siobhan Davis™.</p> <p>Everything changed after the attempt on my life, and now, I’m more determined than ever to crush my enemies until they lie in pieces at my feet.</p> <p>Sinner believes he has pushed me into a corner, but he underestimates my thirst for revenge.</p> <p>Nothing will stand in my way.</p> <p>And I’m no longer in this alone. Saint, Galen, Caz, and Theo have won my trust and my heart. Together, we are an unbreakable team and an unstoppable force.</p> <p>Staying one step ahead of the game is critical to our success, so we’ve little choice but to partner with the most unlikely of allies. The situation is tense and fraught with danger, and it’s not just our lives at stake.</p> <p>Everything rests on finding the evidence that links The Sainthood to Daphne Leydon’s kidnapping and murder, and we’re running out of time.</p> <p>Sinner thinks war has already come to Lowell. But he has overlooked his deadliest enemy and the challenge that comes from within.</p> <p>We won’t stop until he’s defeated and we have taken his crown.</p> <p>Sinner is going down.</p>"; 
